		function tap_act($tar,obj) {
			$tar.on("tap",obj,function(e) {

				$tar.attr("class",newClassName).trigger(newClassName);
			})
		}
		
		var $maptar = $("#worldmapsvg");
		tap_act($maptar, "#AG");
		tap_act($maptar, "#EMEA");
		tap_act($maptar, "#PRC");
		tap_act($maptar, "#EAP");
		tap_act($maptar, "#MAP");
